import React, { Component } from "react";
import {Layout, Card,CardTitle,CardText,CardActions,Button,CardMenu, MDBBtn, MDBCollapse} from "react-mdl";

class ProjectCard extends Component {
  constructor(props){
    super(props);
  }
  state = {
    collapseID: ""
  }

  toggleCollapse = (collapseID) => {
    this.setState(prevState => ({
      collapseID: prevState.collapseID !== collapseID ? collapseID : ""
    }));
  }
  
  render() {
    return (
      <div className="projects-grid">
        {/* Project */}
        <Layout> 
        <Card shadow={5} style = {{ minWidth: "450", margin: "auto" }}>
          <CardTitle style={{color: "#fff", height: "176px", background:this.props.image}}>
          {this.props.cardTitle}
          </CardTitle>
          <CardText>{this.props.cardText} </CardText>
          <CardActions border>
            <Button colored> <a href={this.props.github}>GitHub</a> </Button>
            <Button colored> <a href={this.props.demo}>Live Demo</a> </Button>
          </CardActions>
          <CardMenu style={{ color: "#fff" }} />
        </Card>
        </Layout>
      </div>
    );
  }
}

export default ProjectCard;
